		// פונקציה להשתקת הסאונד
		function stopSound(event) {
			// אם הסאונד מופעל
			if (soundOn == true) {
				//השתקת הסאונד
				createjs.Sound.muted = true;
				// שינוי הצגת הכפתור ומעבר לפריים 1
				event.currentTarget.gotoAndStop(1);
				event.currentTarget.removeEventListener("mouseover", hoverIn); //הסרת מעבר עכבר לכפתור סאונד
				event.currentTarget.removeEventListener("mouseout", hoverOut); // הסרת מאזין ליציאה ממעבר עכבר לכפתור סאונד
				//עדכון שהסאונד לא מופעל
				soundOn = false;
		
			} else { //אם הסאונד לא מופעל
				// החזרת הקול
				createjs.Sound.muted = false;
				//שינוי הצגת הכפתור ומעבר לפריים 0
				event.currentTarget.gotoAndStop(0);
				soundBtn.addEventListener("mouseover", hoverIn); //הגדרת מעבר עכבר לכפתור סאונד
		        soundBtn.addEventListener("mouseout", hoverOut); // הגדרת מאזין ליציאה ממעבר עכבר לכפתור סאונד
				//עדכון שהסאונד מופעל
				soundOn = true;
			}
		}
		
		// פונקציית התחלת המשחק
		function startGame () {
			stage.removeAllChildren();
			pauseBtn.alpha = 1;
			pauseBtn.cursor = "pointer";
			questionTxt.text = "";
		    timeInterval = setInterval(timeFunction, 1000);  // הגדרת אינטרוול לזמן, כל שניה מתבצע קטע הקוד בתוך הפונקציה timeFunction
		    time = 30;
		    stage.addChild(kitchenBkg);
		    kitchenBkg.subjectSign.subjectTxt.text = "נושא המשחק: " + currentGame;
		    currentInstructions = "בחרו בחיה המחזיקה את התשובה הנכונה";
		    kitchenBkg.instructionsSign.instructionsTxt.text = currentInstructions;
		    stage.addChild(pauseBtn);
		    pauseBtn.addEventListener("click",pauseGame); 
		    stage.addChild(soundBtn);
		    stage.addChild(clock);
			clock.timeTxt.text = "";
		    stage.addChild(kid);
			kid.gotoAndPlay(0);
		    stage.addChild(progressJar);
		    progressJar.progressTxt.text = correctCounter + "/" + gameLength;
		    randNumber(); 
		    currentAnswersArray = createRandomOptions(); 
		    placeQuestion();
		    displayAnimals(); 
		    placeAnswers(); 
		}
		
		// --- זמן ---
		function timeFunction() { // פונקציה המופעלת בכל שניה בהתאם להגדרה של אינטרוול זמן, סופרת את השעון לאחור
		    clock.timeTxt.text = time;
		    time--;
		    timePerQuestion++;
		    if (time < 0) {
				timesUp();
		        clearTimeout(timeInterval);
		    }
		 }
		
		 // פונקציה למסך נגמר הזמן
		 function timesUp () { 
			myMusic.stop(); 
			wrongAnswerSound();
			removeQuestion(); 
			removeIrrelevant(); 
			stage.addChild(darkRec); 
		    stage.addChild(timesUpScreen); 
			mistakeCounter++;
			mistakesArray[randomQuestionNum]++; 
			// מעברי עכבר לכפתור ״לשאלה הבאה״ במסך
			timesUpScreen.nextQuestionBtn.addEventListener("mousehover",hoverIn);
			timesUpScreen.nextQuestionBtn.addEventListener("mouseout",hoverOut);
			timesUpScreen.nextQuestionBtn.addEventListener("click",startGame);
			timesUpScreen.nextQuestionBtn.addEventListener("click", backgroundMusic); // ניגון מוזיקת רקע בכל לחיצה על כפתור המשך
		 }
		
		// חישוב זמן סופי שלקח לכל המשחק
		 function calculateTotalTime () { 
			 if (timePerQuestion > 60) {
				 var min = parseInt(timePerQuestion/60);
				var sec = timePerQuestion % 60;
				if (sec < 10) {
					var sec = "0" + timePerQuestion % 60;
				}
			      }
			 else {
				 var min = 0;
				 var sec = timePerQuestion;
				 }
				 return min + ":" + sec;
			 }
		 
		
		// פונקציה לחישוב ציון סופי למשחק 
		 function grade() { 
		for (var i = 0; i< mistakesArray.length; i++) {
			currentGrade += 100 / (mistakesArray[i]*gameLength);
		}
		return Math.round(currentGrade);
		 }
		
