		// פונקציה להגרלת מספר רנדומלי שהוא יהיה המיקום של השאלה ממערך השאלות שתופיע כעת
		function randNumber () {
			randomQuestionNum = 0;
		
		// מכיל את השאלה ע״פ מיקום במערך השאלות כפי שהוגרל במשתנה randomQuestionNum
		 randomQuestionNum = Math.floor((Math.random() * gameArray.length));
		}
		
		//פונקציה שמערבבת את המסיחים
		function createRandomOptions(){
			// מערך סופי רנדומלי למסיחים של השאלה הנוכחית
		var randomAnswers= [];
		//מערך זמני למסיחים ליצירת המערך הרנדומלי 
		var tempQuestion=gameArray[randomQuestionNum].slice(1);
			//לולאה באורך כמות המסיחים הנוכחית
			for(i=0; i <gameArray[randomQuestionNum].length;i++){
			//הגרלת המסיח אותו אנחנו מוציאים כרגע
			var randAns = Math.floor((Math.random() * tempQuestion.length));
				//הוספת המסיח המוגרל למערך הסופי
				randomAnswers[i]=tempQuestion[randAns];
				//מחיקת המסיח מתוך המערך הזמני
				tempQuestion.splice(randAns,1);
			}
			return randomAnswers; // החזרת התוצאה - מערך מעורבב עם תשובות רנדומליות
		}
		
